import React from 'react';
import{ Link } from 'react-router-dom';

const Mechanics = () => (
  <div>
    <ol>
      <li>time</li>
      <li>space</li>
      <li>chance</li>
    </ol>
    <button>
      <Link to='/'>Home</Link>
    </button>
  </div>
);

export default Mechanics;
